// SPDX-License-Identifier: MIT
pragma solidity 0.8.1;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract nft is ERC721, Ownable {
    uint256 public mintPrice;
    uint256 public maxSupply;
    uint256 public totalSupply;
    uint256 public maxPerWallet;
    bool public isPublicMintEnabled;
    string internal baseTokenUri;
    mapping(address => uint256) public walletMints;
    mapping(uint256 => uint256) public types;

    //  address payable public withdrawWallet;

    constructor() payable ERC721("nfteeeEeee", "NFTE") {
        totalSupply = 0;
        baseTokenUri = "https://ipfs.io/ipfs/QmZ3P5QMc4YxSTWXVmyeFpY14mgss5LnDVLPxjhmuTeX4x?filename=1-c_cat.json";
        maxSupply = 10000;
        isPublicMintEnabled = false;
        maxPerWallet = 3;
    }

    function check_mint() public view returns (bool) {
        return isPublicMintEnabled;
    }

    function mint_enable(bool enabled) public onlyOwner {
        isPublicMintEnabled = enabled;
    }

    //  function setURI(uint256 tokenId_) internal

    function tokenURI(uint256 tokenId_)
        public
        view
        override
        returns (string memory)
    {
        require(_exists(tokenId_), "Token does not exist");
        return
            string(
                abi.encodePacked(
                    baseTokenUri,
                    Strings.toString(tokenId_),
                    ".json"
                )
            );
    }

    function mint(uint256 amount) public payable {
        require(isPublicMintEnabled, "not allow to mint");
        require(amount <= 3, "mint too much");
        require(totalSupply + amount <= maxSupply, "exceed max supply");
        require(
            walletMints[msg.sender] + amount <= maxPerWallet,
            "cant mint more"
        );

        for (uint256 i = 0; i < amount; i++) {
            uint256 newtokenId = totalSupply + 1;
            totalSupply++;
            _safeMint(msg.sender, newtokenId);
        }
        walletMints[msg.sender] = walletMints[msg.sender] + amount;
    }
}
